import '../node_modules/font-awesome/css/font-awesome.min.css'; 

const Header = () => {
    return (
        <>
            <header>
                <div className="logo">
                    Logo
                </div>
                <div className="searchBar">
                    <form>
                        <input type="text" placeholder="Search" />
                        <button>
                            <i className="fa fa-search"></i>
                        </button>
                    </form>
                </div>
            </header>
        </>
    );
}
export default Header;
